import React, {Component} from 'react';
import axios from 'axios';
const API_KEY=process.env.REACT_APP_WOW_API_KEY

export default class Bosses extends Component{
	constructor(props){
		super(props);
		this.state={
			data:[]
		}
	}

	componentDidMount(){
		axios.get(`https://us.api.blizzard.com/wow/boss/?locale=en_US&access_token=${API_KEY}`)
		.then((res)=>{
			let bossData=res;
			this.setState({data:bossData})
			console.log(this.state.data)
		})
	}
	render(){
		return(
			<h1>{this.state.data}</h1>
		)
	}
}
